import React from "react";
import "../styles/Header.scss";
import "../styles/ActionMenu.scss";

export default function ActionMenu(props) {
  return (
    <div className="HeaderWrapper fadeIn">
      <h2>Maak uw keuze:</h2>

      <div className="ActionWrapper fadeIn">
        <h1 style={{ textAlign: "center" }}>Inslag</h1>
      </div>
      <div className="HeaderWrapper fadeIn">
        <h1 style={{ borderColor: "#FF0000", textAlign: "center" }}>Uitslag</h1>
      </div>
    </div>
  );
}
